import { dominio } from "../dominio.js";
export default {
  data() {
    return {
      showPermissionsRoleId: [],
      id: this.$route.params && this.$route.params.id,
    };
  },
  created() {
    this.showPermissionsRol();
  },
  methods: {
    showPermissionsRol() {
      let url = dominio.url + "/api/mostrar-permisos-rol/" + this.id;
